import React from "react";
import ReactDOM from "react-dom";
import App from "./App1";
import Hdata from "./DOH";
//import Loop from "./Loop";
function Loop(val){
	return(
		<App 
	key={val.id}
	IS={val.IS}
	HN={val.HN}
	HP={val.HP}
	/>)
};
ReactDOM.render(
<>{Hdata.map(Loop)}</>
, document.getElementById('root'));
